//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_haraka_256f

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/katzenpost/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("fa67814e0c31ac27fd00e15166f16dfe921cab6693465f3b0cf34ddcc5e526977470d2272d1d2d9b4a1553a114622c4e766a381afe095893415ba4d6627c6abd36fe1768fe84bc0d19addac3e433e32bd04344ec5bf7de48501d82aa24885e990534bffeb6f9ef2f8bc67c35e907217bc36cc2bbda4aac2ae4833dad3a59c493")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("36fe1768fe84bc0d19addac3e433e32bd04344ec5bf7de48501d82aa24885e990534bffeb6f9ef2f8bc67c35e907217bc36cc2bbda4aac2ae4833dad3a59c493")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

	signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
